import { IoSearch } from "react-icons/io5";

const SearchBar = () => {
    return(
        <div className="w-full py-2.5 flex justify-center h-full">
            <div className="max-w-[1240px]">
            <div class="flex justify-between items-center pr-80 pl-2 py-4 rounded-lg border-2 border-black gap-4">
                    <IoSearch className="ml-10" />
                    <form className="flex-grow whitespace-nowrap">Search jobs</form>
                </div>
            </div>
        </div>
    )
}

export default SearchBar
